        <div className="date-time">
          <p>{datetime}</p>
        </div>
      </div>
      <div className="more-info d-flex flex-row">
        <h4>Buyerâ€™s Name : {buyername}</h4>
        <h4>Purchsed worth : {purchasedworth}</h4>
